  당첨자분들은 참여 댓글의 대댓글로도 연락드릴 예정입니다. 
  당첨자분들은 2019년 8/11(일)까지 jjangtbc.jtbc@gmail.com로 [이벤트명 (브라운 면도기 당첨자) / 유튜브 닉네임 / 이름 / 핸드폰 번호/ 경품 발송지(우편번호 포함) / 경품 수령을 위한 개인정보활용 동의 문구 (ex-동의합니다)]를 보내주세요.
  이벤트 참여 댓글이 삭제되거나, 기한 내 정보가 도착하지 않을 시에는 당첨이 자동으로 취소됩니다.
  개인 정보는 경품 발송 용도로만 사용되며 (개인정보는 경품 수령 이후 1개월 후 삭제) 정보 오기재, 받으시는 분의 부주의로 인해 반송된 경품은 재발송이 불가합니다.

